import React, { useState } from 'react'

let Messagewithoutbinding = () => {
  let[msg,setMsg]=useState('Hello')
 
  return <div>
      <h1>{msg}</h1>
      <button onClick={()=>{setMsg}}></button>
  </div>
}
export default Messagewithoutbinding
